  d_nlp.g = res[2];
  d_nlp.lam_x = res[3];
  d_nlp.lam_g = res[4];
  d_nlp.lam_p = res[5];
  d_nlp.prob = &p_nlp;
  p_nlp.nx = 54;
  p_nlp.ng = 30;
  p_nlp.np = 108;
  p_nlp.detect_bounds.ng = 0;
  casadi_nlpsol_init(&d_nlp, &arg, &res, &iw, &w);
  if (d_nlp.x0) {
    casadi_copy(d_nlp.x0, 54, d_nlp.z);
  } else {
    casadi_clear(d_nlp.z, 54);
  }
  if (d_nlp.lbx) {
    casadi_copy(d_nlp.lbx, 54, d_nlp.lbz);
  } else {
    casadi_fill(d_nlp.lbz, 54, -casadi_inf);
  }
  if (d_nlp.ubx) {
    casadi_copy(d_nlp.ubx, 54, d_nlp.ubz);
  } else {
    casadi_fill(d_nlp.ubz, 54, casadi_inf);
  }
  if (d_nlp.lam_x0) {
    casadi_copy(d_nlp.lam_x0, 54, d_nlp.lam);
  } else {
    casadi_clear(d_nlp.lam, 54);
  }
  if (d_nlp.lbg) {
    casadi_copy(d_nlp.lbg, 30, d_nlp.lbz+54);
  } else {
    casadi_fill(d_nlp.lbz+54, 30, -casadi_inf);
  }
  if (d_nlp.ubg) {
    casadi_copy(d_nlp.ubg, 30, d_nlp.ubz+54);
  } else {
    casadi_fill(d_nlp.ubz+54, 30, casadi_inf);
  }
  if (d_nlp.lam_g0) {
    casadi_copy(d_nlp.lam_g0, 30, d_nlp.lam+54);
  } else {
    casadi_clear(d_nlp.lam+54, 30);
  }
